import React, {
  useState,
  useEffect
} from "react";
import {
  makeStyles
} from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles({
  root: {
    minWidth: 200
  },
  bullet: {
    display: "inline-block",
    margin: "0 2px",
    transform: "scale(0.8)"
  },
  title: {
    fontSize: 14
  },
  pos: {
    marginBottom: 12
  }
});

export default function OutlinedCard() {
  const classes = useStyles();
  const ListUrl = "http://localhost:3000/colleges";

  const [userData, setUserData] = useState({});

  useEffect(() => {
    getListDataWithFetch();
  }, []);

  const getListDataWithFetch = async () => {
    const response = await fetch(ListUrl);
    const jsonData = await response.json();
    setUserData(jsonData);
  };

  return ( <
    Card className = {
      classes.root
    }
    variant = "outlined" >
    <
    CardContent >
    <
    Typography className = {
      classes.title
    }
    color = "textSecondary"
    gutterBottom >
    {
      userData.Recognition
    } {
      " "
    } <
    /Typography> <
    Typography variant = "h5"
    component = "h2" > {
      " "
    } {
      userData.Name
    } {
      " "
    } <
    /Typography> <
    Typography className = {
      classes.pos
    }
    color = "textSecondary" > {
      " "
    } {
      userData.CurrentRatings
    } {
      " "
    } <
    /Typography> <
    Typography variant = "body2"
    component = "p" > {
      " "
    } {
      userData.Address
    } {
      " "
    } <
    /Typography> <
    /CardContent> <
    CardActions >
    <
    Button size = "small" > View In Details < /Button> <
    /CardActions> <
    /Card>
  );
}
